import styled from "styled-components";
import { CardDeck, Card } from "react-bootstrap";
const Cards = styled.div`
  margin: 1rem;
  flex-basis: 45%;
  padding: 1.5rem;
  text-align: left;
  color: inherit;
  text-decoration: none;
  border: 1px solid #eaeaea;
  border-radius: 10px;
  transition: color 0.15s ease, border-color 0.15s ease;
`;

const Layout = styled.div`
min-height: 100vh;
padding: 0 0.5rem;
display: flex;
flex-direction: column;
justify-content: flex-start;
align-items: center;
`;

const Styles = styled.div`
min-height: 100vh;
padding: 0 0.5rem;
display: flex;
flex-direction: column;
justify-content: flex-start;
align-items: center;
`;
export const Home = () => {
  return (
    <Styles>
        <br/>
      <CardDeck>
        <Card>
          <Card.Title>
            <strong>Exterior Estimates</strong>
          </Card.Title>
        </Card>
        <Card>
          <Card.Title>
            <strong>Interior Estimates</strong>
          </Card.Title>
        </Card>
        <Card>
          <Card.Title>
            <strong>Cabinet Estimates</strong>
          </Card.Title>
        </Card>
        <Card>
          <Card.Title>
            <strong>Cabinet Estimates</strong>
          </Card.Title>
        </Card>
      </CardDeck>
    </Styles>
  );
};
